/** @format */

function Header() {
  return (
    <header>
      <img src="./images/logo.svg"></img>
      <ul>
        <li>Model S</li>
        <li> Model 3</li>
        <li>Model X</li>
        <li>Model Y</li>
        <li>Solar Roof</li>
        <li>Solar Panels</li>
      </ul>
      <ul>
        <li>Shop</li>
        <li> Account</li>
        <li>Menu</li>
      </ul>
    </header>
  );
}

export default Header;
